/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `buscar_inventario`(IN `crit` VARCHAR(255))
BEGIN
SELECT * FROM minventarios WHERE medicamento LIKE CONCAT('%',crit,'%') or
                                       id LIKE CONCAT('%',crit,'%');
    END */$$
