/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insertaReceta`(IN `Id_receta` INT(11), IN `Folio` VARCHAR(20), IN `ordinariamedicamentoscontrolados` VARCHAR(40), IN `AreaUsu` VARCHAR(50), IN `Clave_servicio` VARCHAR(30), IN `Nom_servicio` VARCHAR(200), IN `No_licencia` VARCHAR(30), IN `Cobertura` VARCHAR(1), IN `Fecha_Elaboracion` DATE, IN `No_Afiliacion` VARCHAR(20), IN `Nombre` VARCHAR(200), IN `Apellido_P` VARCHAR(50), IN `Apellido_M` VARCHAR(50), IN `Clave_M` VARCHAR(40), IN `Nombre_M` VARCHAR(200), IN `Clave_Diagnostico` VARCHAR(200), IN `Dosis` VARCHAR(40), IN `Duracion` VARCHAR(40), IN `Cantidad_solicitada` VARCHAR(40), IN `Cantidad_surtida` VARCHAR(40), IN `motivo` VARCHAR(40), IN `Edad` VARCHAR(50), IN `Genero` VARCHAR(2), IN `Clave_M2` VARCHAR(40), IN `Nombre_M2` VARCHAR(200), IN `Clave_Diagnostico2` VARCHAR(200), IN `Dosis2` VARCHAR(40), IN `Duracion2` VARCHAR(40), IN `Cantidad_solicitada2` VARCHAR(40), IN `Cantidad_surtida2` VARCHAR(40), IN `motivo2` VARCHAR(40), IN `Clave_M3` VARCHAR(40), IN `Nombre_M3` VARCHAR(200), IN `Clave_Diagnostico3` VARCHAR(200), IN `Dosis3` VARCHAR(40), IN `Duracion3` VARCHAR(40), IN `Cantidad_solicitada3` VARCHAR(20), IN `Cantidad_surtida3` VARCHAR(20), IN `motivo3` VARCHAR(40), IN `Ent_cajas` VARCHAR(20), IN `Recibi_cajas` VARCHAR(20), IN `Fecha_recibido` DATE, IN `Id_expediente` INT(11), IN `Id_unidad` INT(11), IN `Id_trabajador` INT(11), IN `remember_token` VARCHAR(100), IN `created_at` TIMESTAMP, IN `updated_at` TIMESTAMP, IN `deleted_at` TIMESTAMP)
